    <font size="4" color="red"><b>What is VPN?</b></font><br>
    <font size="3" color="white">
    In general, the notion of VPN is a communication network technology that creates a secure network connection through a public network, such as the internet, or a private network owned by a service provider.<br>
    In other words, VPN is a connection between one network and another private network (private) through a public network (internet).<br><br>
    <b><strong>The following is an explanation of the meaning of each word in Virtual Private Network:</strong></p></b>
    <p style="font-family:courier,arial,helvetica;" align="left">
        <i><b><strong>Virtual :</strong></b> Things that are not real or pseudo, in the virtual world / internet.</i><br>
        <i><b><strong>Private :</strong></b> Things that are private, cannot be accessed by just anyone. To keep it secret from public networks, all data will be encrypted.</i><br>
        <i><b><strong>Network :</strong></b> Network of interconnected connections.</i><br>
</p>
<p style="font-family:courier,arial,helvetica;" align="center" >
